import React from "react";
import { useState } from "react";
import TeamsComp from "../League components/TeamsComp";

const Teams = () => {
  const [league, setLeague] = useState("");
  const [team, setTeam] = useState("");
  const [visible, setVisible] = useState(false);

  const openModal = () => setVisible((prev) => !prev);

  console.log(league, team);
  return (
    <div className="w-[calc(100%-250px)] h-full  absolute top-0 left-[250px] flex-col  items-center">
      {visible && (
        <TeamsComp openClose={openModal} league={league} team={team} />
      )}
      <h1>Please select your league and enter teams name </h1>
      <div className="flex flex-col">
        <div className="flex ">
          <input
            onChange={(event) => setTeam(event.target.value)}
            className="bg-yellow"
          ></input>
          <select onClick={(event) => setLeague(event.target.value)}>
            <option>Premier League</option>
            <option>LaLiga</option>
            <option>Austrian Bundesliga</option>
            <option>Serie A</option>
            <option>Ligue 1</option>
            <option>Russian Premier League</option>
            <option>Liga Portugal</option>
            <option>Eredivisie</option>
            <option>Jupiler pro league</option>
            <option>Brasileirao</option>
            <option>Mls</option>
            <option>Liga MX</option>
            <option>SPFL</option>
            <option>2.Bundesliga</option>
            <option>1.Hnl</option>
          </select>
        </div>
        <button onClick={openModal}>Search</button>
      </div>
    </div>
  );
};

export default Teams;
